import React from "react";
import Typewriter from "typewriter-effect";

function home() {
  return (
    <Typewriter
      onInit={(typewriter) => {
        typewriter
          .typeString("I am Anish Kumar Singh")
          .pauseFor(2500)
          .deleteAll()

          .start();
      }}
    />
  );
}

export default home;
